"""Una vez hecho esto podemos abrirlos para leerlos con la instruccion *f = open(archivo,"r")* donde *archivo* es un string que contiene el nombre del archivo (por ejemplo, "sudoku1.txt")

A continuación se muestra una función que recibe el nombre de un archivo que contiene el estado de un sudoku y lo pone en una matriz la cual devuelve como resultado para que lo use en su tarea:
"""

import numpy as np
# Leer matriz
def leer_matriz(archivo):
  f = open(archivo,"r")
  M = np.zeros((9,9),dtype=int)
  for i in range(0,9):
    linea = f.readline()
    b = linea.split()
    for j in range(0,9):
      M[i,j] = int(b[j])
  return M

"""Se le pide entonces que escriba una función (aquí la llamaremos *pruebaSudoku*), que reciba una matriz con el estado inicial de un sudoku y la complete (modificándola) de modo de solucionar el problema con una estrategia de backtracking, esto es, para cada celda de la matriz inicial en blanco (con un 0 en este caso) se pone un valor y se prueba recursivamente si con ese valor el problema se soluciona. Si es así, se retorna éxito (*True*). Si no, se prueba con otro valor hasta que se obtiene una solución o se acaban las posibilidades, después de lo cual se retorna fracaso (*False*).

Puede crear todas las funciones auxiliares que requiera para implementar la función *pruebaSudoku*. Para programar su función debe usar los *array* de *numpy*. Los únicos métodos de los objetos de tipo *array* que puede utilizar en su solución son los siguientes:

- El método *array* para crear un arreglo.
- Los métodos *zeros* y *ones* para inicializar un *array*.
- El método *copy* para copiar los valores de un *array*.
- El operador de slice $[start:end]$ para obtener un slice de un *array*.

La siguiente función debería rellenar la matriz con la solucion (modifíquela):
"""

def verificar(M,n,i,j):
  #comprobar si puedo meter en el sudoku en la fila i o en la columna j
  #numero no debe estar en la fila ni en la columna ni en el bloque
  #obtener fila de sudoku
  fila = M[i]
  #obtener columna de sudoku
  columna = [c[j] for c in M]
  #para obtener el bloque de sudoku
  bloque = [M[x][y]
            for x in range(9) #largo sudoku
            for y in range(9)
            if i // 3 == x // 3 #verificar por medio de division entera
            and j // 3 == y // 3]

  if n not in fila and n not in columna and n not in bloque:
    return True
  else:
    return False

def pruebaSudoku(M):
  #por todas las casillas en blanco, recorrer cada fila y columna
  for i in range(9):
    for j in range(9):
      #recorrer en las casillas vacias
      if M[i][j] == 0:
        #probar numeros del 1 al 9
        for n in range(1,10):
          # revisar si el valor es valido agregarlo en la posicion
          if verificar(M,n,i,j):
            M[i][j] = n
            if pruebaSudoku(M):
              #si funciona el numero return True
              return True
            else:
              M[i][j] = 0
          #si ningun numero es valido
        # backtracing
        return False
  #sudoku ya solucionado
  return True

"""Una vez programada su función, puede probarla usando el siguiente programa. Con la función `pruebaSudoku` escrita por usted, el programa debería generar la salida que ahí se muestra."""

for i in range(1, 8):
  sinSolucion = "sudoku" + str(i) + ".txt"
  conSolucion = "solsudoku" + str(i) + ".txt"
  A = leer_matriz(sinSolucion)
  print("Probando solución para " + sinSolucion + ":")
  print(A)
  B = leer_matriz(conSolucion)
  print(" ")
  print("La solución correcta es:")
  print(B)
  print(" ")
  pruebaSudoku(A)
